// components/LoadingAnimation/LoadingAnimation.js
import React from 'react';
import './LoadingAnimation.css';

const LoadingAnimation = () => {
  const numChips = 20;
  const chipElements = Array.from({ length: numChips }).map((_, index) => (
    <div className="chip" key={index} />
  ));

  return (
    <div className="loading-container">
      <div className="chip-stack">{chipElements}</div>
    </div>
  );
};

export default LoadingAnimation;
